css:
atom-text-editor,
:host {
  background-color: #161822;
  color: #c7c9d1;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #22273f;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #22273f;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #22273f;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #1f2233;
  color: #4e5783;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #2b335a;
  color: #e0e3f0;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #e0e3f0;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #4e5783;
}
atom-text-editor .invisible,
:host .invisible {
  color: #c7c9d1;
}
atom-text-editor .cursor,
:host .cursor {
  color: #c7c9d1;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #282d43;
}
atom-text-editor::shadow .highlight.find-result .region {
  background-color: rgba(199, 201, 209, 0.2);
  border-radius: 2px;
  border-width: 0;
}
atom-text-editor::shadow .highlight.current-result .region,
atom-text-editor::shadow .highlight.current-result ~ .highlight.selection .region {
  background-color: rgba(226, 165, 120, 0.2);
  border-radius: 2px;
  border-width: 0;
}
.comment {
  color: #6c7189;
}
.entity.name.type {
  color: #e2a578;
}
.entity.other.inherited-class {
  color: #b5bf82;
}
.keyword {
  color: #85a0c7;
}
.keyword.control {
  color: #85a0c7;
}
.keyword.operator {
  color: #c7c9d1;
}
.keyword.other.special-method {
  color: #85a0c7;
}
.keyword.other.unit {
  color: #a093c8;
}
.storage {
  color: #a093c8;
}
.constant {
  color: #a093c8;
}
.constant.character.escape {
  color: #89b9c2;
}
.constant.numeric {
  color: #a093c8;
}
.constant.other.color {
  color: #89b9c2;
}
.constant.other.symbol {
  color: #b5bf82;
}
.variable {
  color: #b5bf82;
}
.variable.interpolation {
  color: #a1ae61;
}
.variable.parameter.function {
  color: #c7c9d1;
}
.invalid.illegal {
  background-color: #e27878;
  color: #161822;
}
.string {
  color: #89b9c2;
}
.string.regexp {
  color: #89b9c2;
}
.string.regexp .source.ruby.embedded {
  color: #e2a578;
}
.string.other.link {
  color: #e27878;
}
.punctuation.definition.comment {
  color: #6c7189;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #c7c9d1;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #85a0c7;
}
.punctuation.definition.bold {
  color: #e2a578;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #a093c8;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #b5bf82;
}
.support.class {
  color: #e2a578;
}
.support.function {
  color: #89b9c2;
}
.support.function.any-method {
  color: #85a0c7;
}
.entity.name.function {
  color: #85a0c7;
}
.entity.name.class,
.entity.name.type.class {
  color: #e2a578;
}
.entity.name.section {
  color: #85a0c7;
}
.entity.name.tag {
  color: #85a0c7;
}
.entity.other.attribute-name {
  color: #a093c8;
}
.entity.other.attribute-name.id {
  color: #85a0c7;
}
.meta.class {
  color: #e2a578;
}
.meta.link {
  color: #e2a578;
}
.meta.require {
  color: #85a0c7;
}
.meta.selector {
  color: #a093c8;
}
.meta.separator {
  background-color: #6c7189;
  color: #c7c9d1;
}
.none {
  color: #c7c9d1;
}
.markup.bold {
  color: #e2a578;
  font-weight: bold;
}
.markup.changed {
  color: #a093c8;
}
.markup.deleted {
  color: #e27878;
}
.markup.italic {
  color: #a093c8;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #85a0c7;
}
.markup.inserted {
  color: #b5bf82;
}
.markup.list {
  color: #e27878;
}
.markup.quote {
  color: #e2a578;
}
.markup.raw.inline {
  color: #b5bf82;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #b5bf82;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.spell-check-misspelling .region {
  border-bottom: #e27878 dotted 1px;
}
.bracket-matcher .region {
  background-color: #3f455f;
  color: #ffffff;
  border-width: 0;
}
